import  './ExpenseItem.css';

function ExpenseItem(props) {
    return (//jsx requires one overarching div as opposed to multiple root level divs
        <div className="expense-item">
            <div>
                <div>{props.date.toLocaleString('en-US', {})}</div>
            </div>
            <div>{props.date.toISOString()}</div>//objects need too be called upon differently ex. .toISOString
            <div className="expense-item__description">
                <h2>{props.title}</h2>
                <div className="expense-item__price">{props.amount}</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
